import React,{useState} from 'react'


export default function Message() {
    const messages=useState([
        {id:1,title:'消息1',content:'锄禾日当午'},
        {id:2,title:'消息2',content:'汗滴禾下土'},
        {id:3,title:'消息3',content:'谁知盘中餐'},
        {id:4,title:'消息4',content:'粒粒皆辛苦'},
    ])
  return (
    <div>
        <ul>
            {
                messages.map(m=>{
                    return <li key={m.id}>
                        <a href="./"></a>
                    </li>
                })
            }
        </ul>
    </div>
  )
}
